import './App.css';
import Publication from './components/Publication'
import SidePanel from './components/SidePanel'
import Navigation from './components/Navigation'

function App() {

  return (

    <div className="container-fluid pt-2 mt-5 bg-light">
      <div className="row">
        <Navigation />
      </div>
      <div className="row">
        <div  className="col-md-5 col-lg-5 col-sm-12 p-3">
          <SidePanel />
        </div>
        <main role="main" className="col-md-5 col-lg-5 col-sm-12 p-3">
          <Publication />
        </main>
        <div className="col">

        </div>
      </div>

    </div>
  );
}

export default App;
